MovieClip.prototype.rewindme = function(frm){
	this.onEnterFrame = function(){
		if(this._currentframe > frm){
			this.gotoAndStop(this._currentframe-1);
		}else{
			this.gotoAndStop(frm);
			delete this.onEnterFrame;
		}
	}
}
MovieClip.prototype.scaleme = function(A) {
	this.onEnterFrame = function() {
		this._xscale += (A-this._xscale)/2;
		this._yscale += (A-this._yscale)/2;
		if (this._xscale<=(A+1) && this._xscale>=(A-1)) {
			this._xscale = A;
			this._yscale = A;
			this.onEnterFrame = undefined;
		}
	};
}
MovieClip.prototype.scalemoveme = function(X,Y,A) {
	this.onEnterFrame = function() {
		this._x += (X-this._x)/2;
		this._y += (Y-this._y)/2;
		this._xscale += (A-this._xscale)/2;
		this._yscale += (A-this._yscale)/2;
		if (this._xscale<=(A+1) && this._xscale>=(A-1)) {
			this._xscale = A;
			this._yscale = A;
			this._x = X;
			this._y = Y;
			this.onEnterFrame = undefined;
		}
	};
}
MovieClip.prototype.moveme = function(X,Y) {
	this.onEnterFrame = function() {
		this._x += (X-this._x)/2;
		this._y += (Y-this._y)/2;
		if (this._x<=(X+1) && this._x>=(X-1)) {
			if (this._y<=(Y+1) && this._y>=(Y-1)) {
				this._x = X;
				this._y = Y;
				this.onEnterFrame = undefined;
			}
		}
	};
}
